import {SIGN_IN} from 'redux/action_types';
import AuthService from 'services/auth'
const authService = new AuthService();

export const login = data => (dispatch)=>{
    authService._login.then(res=>{
        dispatch({
            type: SIGN_IN,
            payload:res
        })
    })
    .catch(err=>{

    })
}
